import React from 'react';
import { Table, Container } from 'react-bootstrap';

const TasksPage = () => {
  // Mock data for tasks
  const tasks = [
    { id: 1, name: 'Zadanie 1', description: 'Opis zadania 1', createdDate: '2023-06-01', deadline: '2023-06-15', status: 'W trakcie' },
    { id: 2, name: 'Zadanie 2', description: 'Opis zadania 2', createdDate: '2023-06-05', deadline: '2023-06-30', status: 'Zakończone' },
  ];

  return (
    <Container>
      <h2>Strona "Zadania"</h2>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Nazwa</th>
            <th>Opis</th>
            <th>Data utworzenia</th>
            <th>Termin</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task) => (
            <tr key={task.id}>
              <td>{task.name}</td>
              <td>{task.description}</td>
              <td>{task.createdDate}</td>
              <td>{task.deadline}</td>
              <td>{task.status}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default TasksPage;
